defs.script:
function hover(e, bez, bezname)
{
  var re = e.target;
  var bezout = document.getElementById('textBez');
  var beznameout = document.getElementById('textBezName');
  re.style.setProperty('fill-opacity','.8','');
  bezout.textContent = bez+'.';
  beznameout.textContent = bezname;
}
function out(e)
{
  var re = e.target;
  var bezout = document.getElementById('textBez');
  var beznameout = document.getElementById('textBezName');
  re.style.setProperty('fill-opacity','0','');
  bezout.textContent = '';
  beznameout.textContent = '';
}
